FeedPackage.Description:
Serves a C# client to your API at /swagger/v1/csclient for your users to use instead of using external utilities.

Add

app.UseGeneratedSwashbuckleCSharpClient();

(using Swashbuckle.Swagger.Extension.Client;)

After this in Configure(..) method in Startup.cs:

app.UseSwagger();
app.UseSwaggerUi();

