FeedPackage.ReleaseNotes:
InitialRelease

there are some issues on ios at the moment.

1. The renderer doesn't appear to get loaded unless you reference it in your appdelegate in some way 

.e.g.
public override bool FinishedLaunching(UIApplication app, NSDictionary options)
        {
            global::Xamarin.Forms.Forms.Init();
            var x = typeof(Plugin.GridViewControl.iOS.Renderers.GridViewRenderer);
            LoadApplication(new App());

            return base.FinishedLaunching(app, options);
        }

2. For some reason the selection state xib has become mandatory. So currently you need to manually add the statelist_item_background.xib from the git repo to your ios project. I haven't figured out how to do this with the nuget package manager yet.

FeedPackage.Description:
Changes the size of a captured image on the device. Particularly useful for sending images from the device to an API when you don't want massive files.
To use: await CrossImageResizer.Current.ResizeImageWithAspectRatioAsync(originalImageByteArray, maxWidth, maxHeight);
**NOTE** Only currently tested against Android, but an iOS implementation is available. Use at your own risk, or contribute! https://github.com/lreading/Xamarin-Image-Resizer

